class UserModel{constructor(){this.id="";this.userName="";this.email="";this.password="";this.role=UserRoles.User;this.isEnabled=!0;this.isUserNameValid=!0;this.isEmailValid=!0;this.isPasswordValid=!0}validate=function(n){this.validateUserName();this.validateEmail();this.validatePassword();return(this.isUserNameValid&&this.isEmailValid&&this.isPasswordValid)};validateEmail=function(){this.isEmailValid=(this.email.length>=5);return this.isEmailValid};validatePassword=function(){if(this.id.length>0&&this.password.length==0){this.isPasswordValid=true}else{this.isPasswordValid=(this.password.length>=5)}return this.isPasswordValid};validateUserName=function(){this.isUserNameValid=(this.userName.length>=3);return this.isUserNameValid};}